import './App.css';
import { useEffect, useState } from 'react';
function App() {
    const [data, setData] = useState(null);
    const [weddingParty, setWeddingParty] = useState([]);
    useEffect(() => {
      const weddingPartyData = async () =>{
        try{
          const response = await fetch('https://sheetdb.io/api/v1/a0dbckmyb4l8q');
          const responseJson = response.json();
          setData(responseJson);

          data.forEach((person)=>{
            setWeddingParty(weddingParty => [...weddingParty, person.fullname]);
            setWeddingParty(weddingParty => [...weddingParty, person.nickname]);
        })
      } catch (error){
        console.log("error fetching data", error);
      }

    }

    weddingPartyData();



  }, []);

  return (
    <div className="container">
      <div className="form-container">
         <h2 className="cedarville-cursive-regular">Jade and Seka's Wedding Website</h2>
        <input placeholder='Please enter your Full Name to access the site'></input>
        <button>Submit</button>
      </div>
    </div>
  );
}

export default App;
